Handmade Is Back! @crochetcraft.rachel.mona 
@unionsquareny Crocheting is a handicraft technique that involves creating fabric from yarn or thread using a crochet hook. The process typically begins with a slip knot onto the crochet hook, after which additional loops are pulled through the existing loops, creating chains and various stitches to form a pattern or fabric. I have fond memories of my grandmother teaching me this handicraft.
#crochetchristmastree #handmadegifts #crochet  #handicraft #buylocal #supportsmallbusinesses
